        AOS.init({})
    }

    render() {
        return (
            <>
                <ReactBootStrap.Breadcrumb>
                    <ReactBootStrap.Breadcrumb.Item href="/">Home</ReactBootStrap.Breadcrumb.Item>
                    <ReactBootStrap.Breadcrumb.Item active>Blogs</ReactBootStrap.Breadcrumb.Item>
                </ReactBootStrap.Breadcrumb>
                <ReactBootStrap.Container>
                    <h1 style={{ color: '#008987' }}>Blogs</h1>
                    <p style={{ color: '#037BA1' }}>
                        Expert Perspective to keep you
                        updated on the Tech Trends.
                     </p>
                </ReactBootStrap.Container>

                <div class="py-5 team3">
                    <div class="container">
                        <div class="row">


                            <div class="row">

                                <ReactBootStrap.Col onClick={() => alert("clicked item")} className="team-single-container" data-aos="fade-up" style={{ textAlign: 'center' }} md={4}>
                                    <ReactBootStrap.Col style={{ alignItems: 'center' }}>
                                        <ReactBootStrap.Image style={{ width: '20vh', height: '20vh', border: '2px solid #eee' }} src="/assets/career 1.png"     />
                                    </ReactBootStrap.Col>

                                    <h5 class="mt-4 font-weight-medium mb-0"><b>Title: </b>lorem ipsum is ipsum lorem</h5>
                                    <p>You can relay on our amazing features list and also our customer services will be great experience.</p>
                                </ReactBootStrap.Col>

                                <ReactBootStrap.Col className="team-single-container" data-aos="fade-up" style={{ textAlign: 'center' }} md={4}>
                                    <ReactBootStrap.Col style={{ alignItems: 'center' }}>
                                        <ReactBootStrap.Image style={{ width: '20vh', height: '20vh', border: '2px solid #eee' }} src="/assets/career 1.png" roundedCircle />
                                    </ReactBootStrap.Col>

                                    <h5 class="mt-4 font-weight-medium mb-0">Michael Doe</h5>
